-- ----------------------------
-- Table structure for pedido
-- ----------------------------
DROP TABLE IF EXISTS `pedido`;
CREATE TABLE `pedido` (
  `codpedido` int(11) NOT NULL AUTO_INCREMENT,
  `codpromotor` int(11) DEFAULT NULL,
  `numeropedido` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `numerodocumento` int(11) DEFAULT NULL,
  `subtotal` decimal(10,2) DEFAULT NULL,
  `igv` decimal(10,2) DEFAULT NULL,
  `total` decimal(10,2) DEFAULT NULL,
  `fechapedido` datetime DEFAULT NULL,
  `fechaenvio` datetime DEFAULT NULL,
  `fecharegistro` datetime DEFAULT NULL,
  `codUsuario` int(11) DEFAULT NULL,
  `estado` int(11) DEFAULT NULL,
  PRIMARY KEY (`codpedido`),
  KEY `fkpedido_promotor` (`codpromotor`) USING BTREE,
  CONSTRAINT `pedido_ibfk_1` FOREIGN KEY (`codpromotor`) REFERENCES `promotor` (`codPromotor`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

