-- ----------------------------
-- Table structure for precios
-- ----------------------------
DROP TABLE IF EXISTS `precios`;
CREATE TABLE `precios` (
  `codprecio` int(11) NOT NULL AUTO_INCREMENT,
  `codcampana` int(11) NOT NULL,
  `codusuario` int(11) DEFAULT NULL,
  `fecharegistro` datetime DEFAULT NULL,
  `estado` bit(1) DEFAULT NULL,
  PRIMARY KEY (`codprecio`),
  KEY `codusuario` (`codusuario`) USING BTREE,
  KEY `codcampana` (`codcampana`) USING BTREE,
  CONSTRAINT `precios_ibfk_1` FOREIGN KEY (`codcampana`) REFERENCES `campana` (`codcampana`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `precios_ibfk_2` FOREIGN KEY (`codusuario`) REFERENCES `usuario` (`usuarioid`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

-- ----------------------------
-- Records of precios
-- ----------------------------

-- ----------------------------
-- Table structure for premio
-- ----------------------------
DROP TABLE IF EXISTS `premio`;
CREATE TABLE `premio` (
  `codpremio` int(11) NOT NULL AUTO_INCREMENT,
  `codcampaña` int(11) DEFAULT NULL,
  `codpromotor` int(11) DEFAULT NULL,
  `comprafacturada` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `fecha` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `premioregular` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `envioregular` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `premioafil` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `valido` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `entregado` int(11) DEFAULT '0' COMMENT '1 ENTREGADO\r\n0 NO ENTREGADO',
  `fechaentrega` datetime DEFAULT CURRENT_TIMESTAMP,
  `codusuario` int(11) DEFAULT NULL,
  `fecharegistro` datetime DEFAULT NULL,
  `estado` int(11) DEFAULT NULL,
  PRIMARY KEY (`codpremio`),
  KEY `fk_campaña` (`codcampaña`) USING BTREE,
  KEY `fk_promotor` (`codpromotor`) USING BTREE,
  CONSTRAINT `premio_ibfk_1` FOREIGN KEY (`codcampaña`) REFERENCES `campana` (`codcampana`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `premio_ibfk_2` FOREIGN KEY (`codpromotor`) REFERENCES `promotor` (`codPromotor`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

-- ----------------------------
-- Records of premio
-- ----------------------------

-- ----------------------------
-- Table structure for producto
-- ----------------------------
DROP TABLE IF EXISTS `producto`;
CREATE TABLE `producto` (
  `codproducto` int(11) NOT NULL AUTO_INCREMENT,
