  `descripcion` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `descripcion2` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `marca` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `modelo` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `color` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `genero` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `familia` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `categoria` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `tipomarca` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `subcat` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `nivel6` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `talla` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `cantidad` int(11) DEFAULT NULL,
  `fecha` datetime DEFAULT NULL,
  `precd` decimal(10,2) DEFAULT NULL,
  `subtotal` decimal(10,2) DEFAULT NULL,
  `igv` decimal(10,2) DEFAULT NULL,
  `total` decimal(10,2) DEFAULT NULL,
  `preprom` decimal(10,2) DEFAULT NULL,
  `subtotalpreprom` decimal(10,2) DEFAULT NULL,
  `igvpreprom` decimal(10,2) DEFAULT NULL,
  `totalpreprom` decimal(10,2) DEFAULT NULL,
