  `totalprepromdescuento` decimal(10,2) DEFAULT NULL,
  `ndoc` int(11) DEFAULT NULL,
  `origen` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `tdoc` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `tnumero` varchar(255) COLLATE utf8_spanish_ci DEFAULT '',
  `codusuario` int(11) DEFAULT NULL,
  `fecharegistro` datetime DEFAULT NULL,
  `estado` bit(1) DEFAULT NULL,
  PRIMARY KEY (`codproducto`)
) ENGINE=InnoDB AUTO_INCREMENT=3246 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

