-- ----------------------------
-- Table structure for productounidad
-- ----------------------------
DROP TABLE IF EXISTS `productounidad`;
CREATE TABLE `productounidad` (
  `codproductounidad` int(11) NOT NULL AUTO_INCREMENT,
  `codproducto` int(11) NOT NULL,
  `codunidadmedida` int(11) NOT NULL,
  `precioventa` decimal(10,4) DEFAULT NULL,
  `preciocompra` decimal(10,4) DEFAULT NULL,
  `codUser` int(11) DEFAULT NULL,
  `fecharegistro` datetime DEFAULT NULL,
  `estado` int(1) DEFAULT NULL,
  PRIMARY KEY (`codproductounidad`),
  KEY `fk_1` (`codproducto`) USING BTREE,
  KEY `fk_2` (`codunidadmedida`) USING BTREE,
  CONSTRAINT `productounidad_ibfk_1` FOREIGN KEY (`codproducto`) REFERENCES `producto` (`codproducto`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `productounidad_ibfk_2` FOREIGN KEY (`codunidadmedida`) REFERENCES `unidadmedida` (`codUnidadMedida`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

