-- Table structure for promotor
-- ----------------------------
DROP TABLE IF EXISTS `promotor`;
CREATE TABLE `promotor` (
  `codPromotor` int(11) NOT NULL AUTO_INCREMENT,
  `codigosap` int(10) DEFAULT NULL,
  `nombre` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `departamento` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `provincia` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `distrito` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `direccion` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `dni` varchar(11) COLLATE utf8_spanish_ci DEFAULT NULL,
  `telefono1` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `telefono2` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `celular1` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `celular2` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `email` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `fechanacimiento` datetime DEFAULT NULL,
  `fecharegistro` datetime DEFAULT NULL,
  `razonsocial` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `genero` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `estadocivil` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `regimen` varchar(2) COLLATE utf8_spanish_ci DEFAULT NULL,
  `prospecto` varchar(2) COLLATE utf8_spanish_ci DEFAULT NULL,
  `estado` bit(1) DEFAULT NULL,
  `coddocumentoidentidad` int(11) DEFAULT '1',
  PRIMARY KEY (`codPromotor`)
) ENGINE=InnoDB AUTO_INCREMENT=1052 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

