-- ----------------------------
-- Table structure for puntos
-- ----------------------------
DROP TABLE IF EXISTS `puntos`;
CREATE TABLE `puntos` (
  `codpunto` int(11) NOT NULL AUTO_INCREMENT,
  `codpromotor` int(11) DEFAULT NULL,
  `puntaje` decimal(10,2) DEFAULT NULL,
  `fecharegistro` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `codusuario` int(11) DEFAULT NULL,
  `estado` int(11) DEFAULT NULL,
  PRIMARY KEY (`codpunto`),
  KEY `codpromotor` (`codpromotor`) USING BTREE,
  CONSTRAINT `puntos_ibfk_1` FOREIGN KEY (`codpromotor`) REFERENCES `promotor` (`codPromotor`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

-- ----------------------------
-- Records of puntos
-- ----------------------------

-- ----------------------------
-- Table structure for repositorio
-- ----------------------------
DROP TABLE IF EXISTS `repositorio`;
CREATE TABLE `repositorio` (
  `repositorioid` int(11) NOT NULL AUTO_INCREMENT,
  `tipdoc` int(11) NOT NULL,
  `fechaemision` date NOT NULL,
  `serie` varchar(255) COLLATE utf8_spanish_ci NOT NULL,
  `correlativo` varchar(255) COLLATE utf8_spanish_ci NOT NULL,
  `monto` decimal(10,2) NOT NULL,
  `estadosunat` varchar(255) COLLATE utf8_spanish_ci DEFAULT '' COMMENT '"-1" no enviado         "0"  si enviado           "5" documento anulado',
  `mensajesunat` varchar(2000) COLLATE utf8_spanish_ci DEFAULT NULL,
  `docpdf` longblob,
  `docxml` longblob NOT NULL,
  `nombredoc` varchar(255) COLLATE utf8_spanish_ci NOT NULL,
  `usuario` int(11) NOT NULL,
  `fecharegistro` datetime NOT NULL,
  `fechaactualiza` datetime DEFAULT NULL,
  `cdrzip` longblob,
  `codEmpresa` int(11) NOT NULL,
  `codSucursal` int(11) NOT NULL,
  `codAlmacen` int(11) NOT NULL,
  `codFacturaVenta` int(11) NOT NULL,
  PRIMARY KEY (`repositorioid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

-- ----------------------------
-- Records of repositorio
-- ----------------------------

-- ----------------------------
-- Table structure for serie
-- ----------------------------
DROP TABLE IF EXISTS `serie`;
CREATE TABLE `serie` (
  `codSerie` int(11) NOT NULL AUTO_INCREMENT,
