-- ----------------------------
-- Procedure structure for actualiza_estadosunat_repositorio
-- ----------------------------
DROP PROCEDURE IF EXISTS `actualiza_estadosunat_repositorio`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `actualiza_estadosunat_repositorio`(in _repositorioid int(11),
in _estadosunat varchar(255), in _mensajesunat VARCHAR(3000), in _cdrzip longblob,
OUT  _resultado  int(11))
BEGIN 
#Routine body goes here...

			DECLARE cad VARCHAR(500);
			SET cad = (SELECT strSplit(_mensajesunat," ", 1));

			IF cad = 'Client.1033El' THEN

					UPDATE repositorio 
					SET estadosunat = '0', 
							mensajesunat = _mensajesunat,
							fechaactualiza=now(),
							cdrzip = _cdrzip
					WHERE repositorioid=_repositorioid;
					SET _resultado = ROW_COUNT();

					
			ELSE

					UPDATE repositorio 
					SET estadosunat = _estadosunat, 
							mensajesunat = _mensajesunat,
							fechaactualiza=now(),
							cdrzip = _cdrzip
					WHERE repositorioid=_repositorioid;
					SET _resultado = ROW_COUNT();

					
		END IF;
END
;;
DELIMITER ;

