DROP PROCEDURE IF EXISTS `anular_caja`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `anular_caja`(in _cajaid int(11), in _idusuario int(11))
BEGIN
	
	declare _cobro_en_caja int(11) default 0;
	
	set _cobro_en_caja=IFNULL((select COUNT(codcobro) from cobro where codcaja=_cajaid),0);
	
	if(_cobro_en_caja=0)THEN
		
			update caja set estado=0 where codcaja=_cajaid;
			update cajamovimiento set estado=0 where codcaja=_cajaid;

			select ROW_COUNT() as _filas_afectadas;
			


	ELSE
		select -1 as _filas_afectadas;
  end if;
	
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for anular_cobro
-- ----------------------------
DROP PROCEDURE IF EXISTS `anular_cobro`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `anular_cobro`(in _comprobanteid int(11))
BEGIN
declare _fin int(11) DEFAULT 0;
declare _cobroid int(11) default 0;
declare _tipocobroid int(11) default 0;
declare _notacreditoid int(11) default 0;
declare _cajaid int(11) default 0;
declare _monto DECIMAL(10,4) default 0;

declare lista_cobro cursor for 
select  codcobro, codcaja, codmetodopago, monto,codnotacredito from cobro 
where  codcomprobante=_comprobanteid and estado<>0;


DECLARE CONTINUE HANDLER FOR  NOT FOUND SET _fin=1;

update comprobante set abonado=0, situacionpago=0 where codcomprobante=_comprobanteid;

open lista_cobro;
ciclo_loop: LOOP
fetch lista_cobro into _cobroid,_cajaid,_tipocobroid,_monto,_notacreditoid;
if ( _fin=1) then
leave ciclo_loop;
end if;

case _tipocobroid

when 1 then 
  update caja set totalefectivo=totalefectivo-_monto, totaldisponible=totaldisponible-_monto where codcaja=_cajaid;
when 2 THEN
	update caja set totaldeposito=totaldeposito-_monto where codcaja=_cajaid;
	call anular_pagocomprobante(_comprobanteid);
	
when 3 THEN
	update caja set totaltarjeta=totaltarjeta-_monto where codcaja=_cajaid;
when 4 THEN
	update caja set totaltransferencia=totaltransferencia-_monto where codcaja=_cajaid;
when 5 THEN
	update caja set totaltarjeta=totaltarjeta-_monto where codcaja=_cajaid;
when 6 THEN
	update caja set totalnotacredito=totalnotacredito-_monto where codcaja=_cajaid;
	update comprobante set estado=1 WHERE codcomprobante=_notacreditoid;
end case;

update cobro set estado=0 where codcobro=_cobroid;

update cajamovimiento set estado=0 where codcaja=_cajaid and codcobro=_cobroid;

end LOOP ciclo_loop ;
CLOSE lista_cobro;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for anular_cobro_xid
-- ----------------------------
DROP PROCEDURE IF EXISTS `anular_cobro_xid`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `anular_cobro_xid`(in _idcobro int(11),
in _idusuario int(11))
BEGIN
DECLARE _cajaid int(11) default 0;
DECLARE _tipocobroid int(11) default 0;
declare _estadocobro int(11) default 0;
declare _montocobro decimal(10,4) default 0;
declare _notacreditoid int(11) default 0;
declare _idcomprobante int(11) default 0;
declare _montocanceladocomprobante decimal(10,4) default 0;

set _cajaid=(
SELECT ifnull(cajaid,0) 
from cobro 
where codcobro= _idcobro);

set _tipocobroid=(
SELECT ifnull(codmetodopago,0) 
from cobro 
where codcobro= _idcobro);

set _estadocobro=(
SELECT ifnull(estado,0) 
from cobro 
where codcobro= _idcobro);

set _montocobro=(
SELECT ifnull(monto,0) 
from cobro 
where codcobro= _idcobro);

set _notacreditoid=(
SELECT ifnull(codnotacredito,0) 
from cobro 
where codcobro= _idcobro);


if(_estadocobro=1)THEN

	set _idcomprobante=(
	SELECT IFNULL(codcomprobante,0)
	FROM cobro 
	where codcobro=_idcobro
	);
	
	if(_idcomprobante>0)THEN	
		
				update comprobante set montocancelado=montocancelado-_montocobro where codcomprobante=_idcomprobante;
				
				set _montocanceladocomprobante=(
					select ifnull(montocancelado,0)
					from comprobante
					where codcomprobante=_idcomprobante 
				);


				if(_montocanceladocomprobante=0)then
						UPDATE comprobante set situacionpago=0 where codcomprobante=_idcomprobante;
				ELSE					
						UPDATE comprobante set situacionpago=1 where codcomprobante=_idcomprobante;
				end if;


				case _tipocobroid

				when 1 then 
					update caja set totalefectivo=totalefectivo-_montocobro, totaldisponible=totaldisponible-_montocobro where codcaja=_cajaid;
				when 2 THEN
					update caja set totaldeposito=totaldeposito-_montocobro where codcaja=_cajaid;
				when 3 THEN
					update caja set totaltarjeta=totaltarjeta-_montocobro where codcaja=_cajaid;
				when 4 THEN
					update caja set totaltransferencia=totaltransferencia-_montocobro where codcaja=_cajaid;
				when 5 THEN
					update caja set totaltarjeta=totaltarjeta-_montocobro where codcaja=_cajaid;
				when 6 THEN
					update caja set totalnotacredito=totalnotacredito-_montocobro where codcaja=_cajaid;
					update comprobante set estado=1 WHERE codcomprobante=_notacreditoid;
				end case;

				update cobro set estado=0 where codcobro=_idcobro;

				update cajamovimiento set estado=0 where codcaja=_cajaid and codcobro=_idcobro;

				SELECT ROW_COUNT() as _filas_afectadas;
				
			
	end if;

ELSE

select -1 as _filas_afectadas;

end if;

end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for anular_comprobante
-- ----------------------------
DROP PROCEDURE IF EXISTS `anular_comprobante`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `anular_comprobante`(in _idcomprobante int(11),
in _idusuario int(11))
begin	

declare _cajaabierta int(11);
DECLARE _contadorcobro int(11) default 0;
declare _idticket int(11);
declare _idrepositorio int(11);
declare _estadorepositorio int(11);
declare _tipocomprobante int(11);

set _estadorepositorio=(
select estadosunat
from repositorio 
where  codFacturaVenta=_idcomprobante
);

set _contadorcobro=(
select COUNT(*)
from cobro
where codcomprobante=_idcomprobante
);

set _tipocomprobante=(
select codtipocomprobante
from comprobante 
where codcomprobante=_idcomprobante
);
/*set _cajaabierta=(

select ca.estado
from cobro c
INNER JOIN comprobante com on c.comprobanteid=com.idcomprobante
INNER JOIN caja ca on c.cajaid=ca.cajaid
where com.idcomprobante=_idcomprobante
);*/

if(_estadorepositorio=-1)then

/*if(_cajaabierta=1)then*/

		update comprobante set 
		estado=0 where codcomprobante=_idcomprobante;

		update detallecomprobante set estado=0
		where codcomprobante =_idcomprobante;

		SELECT ROW_COUNT() as _filas_afectadas;


		set _idrepositorio=(
		select repositorioid
		from repositorio
		where codFacturaVenta=_idcomprobante
		);

		update repositorio set estadosunat=5
		where repositorioid=_idrepositorio;



	 if(_tipocomprobante=1 or _tipocomprobante=2)then

				set _idticket=(
				SELECT c.codpedido
				from pedido t
				INNER JOIN comprobante c on t.codpedido=c.codpedido
				where c.codcomprobante=_idcomprobante and t.estado<>0
				);

				update pedido 
				set estado=1
				where codpedido=_idticket;

				if(_contadorcobro>0)then

					call anular_cobro(_idcomprobante);

				end if;

		ELSEIF (_tipocomprobante=3 or _tipocomprobante=8)then

				call anular_nota_credito(_idcomprobante);

		end if;


/*ELSE

	select -3 as _filas_afectadas;*/

/*end if;*/

ELSE

	select -2 as _filas_afectadas;

end if;


end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for anular_nota_credito
-- ----------------------------
DROP PROCEDURE IF EXISTS `anular_nota_credito`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `anular_nota_credito`(in _idcomprobante int(11))
begin

declare _monto_cancelado DECIMAL(10,4) default 0;
declare _monto_total DECIMAL(10,4) default 0;
declare _comprobanteidaplicado int(11);
declare _cobroid int(11);
declare _cajaid int(11);
declare _monto decimal(10,4);
declare _aplicada int(11);

set _aplicada=(
select COUNT(codcobro)
from cobro
where codnotacredito=_idcomprobante and estado=1
);

if(_aplicada=1)THEN

		set _comprobanteidaplicado=(
				select codcomprobante
				from cobro
				where codnotacredito=_idcomprobante and estado=1
		);

		set _cajaid=(
		select codcaja
		from cobro
		where codnotacredito=_idcomprobante and estado=1
		);
		
		set _monto=(
			select monto
			from cobro
			where codnotacredito=_idcomprobante and estado=1
		);

		set _cobroid=(
		select codcobro
		from cobro
		where codnotacredito=_idcomprobante and estado=1
		);

		update caja set totalnotacredito=totalnotacredito-_monto where codcaja=_cajaid;
		update cobro set estado=0 where codcobro=_cobroid;
		update cajamovimiento set estado=0 where codcaja=_cajaid and codcobro=_cobroid;

		update comprobante 
		set montocancelado=IFNULL(montocancelado,0)-_monto
		where codcomprobante=_comprobanteidaplicado;

	  set _monto_cancelado=ifnull((select montocancelado from comprobante where codcomprobante=_comprobanteidaplicado ),0);
	  set _monto_total=ifnull((select total from comprobante where codcomprobante=_comprobanteidaplicado ),0);

		if(_monto_cancelado=_monto_total)then # 0 pago pendiente ,1 parcial, estado 2 pago total
			update comprobante set situacionpago=2 where codcomprobante=_comprobanteidaplicado;
		ELSEif(_monto_cancelado>0) then
			update comprobante set situacionpago=1 where codcomprobante=_comprobanteidaplicado;
		ELSE
			update comprobante set situacionpago=0 where codcomprobante=_comprobanteidaplicado;
		end if;

end if;

end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for anular_pagocomprobante
-- ----------------------------
DROP PROCEDURE IF EXISTS `anular_pagocomprobante`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `anular_pagocomprobante`(in _comprobanteid int(11))
BEGIN
declare _fin int(11) DEFAULT 0;

declare _codpagocomprobante int(11) default 0;
declare _codpago int(11) default 0;
declare _codcomprobante DECIMAL(10,4) default 0;
declare _pago DECIMAL(10,4) default 0;
declare _montopagado DECIMAL(10,4) default 0;
declare _montodeposito DECIMAL(10,4) default 0;
declare _montousado DECIMAL(10,4) default 0;
declare _contador DECIMAL(10,4) default 0;

declare lista_pago cursor for
select  codpagocomprobante,codpago, codcomprobante, pago, montopagado from pagocomprobante 
where  codcomprobante=_comprobanteid and estado<>0;

DECLARE CONTINUE HANDLER FOR  NOT FOUND SET _fin=1;

open lista_pago;
ciclo_loop: LOOP
fetch lista_pago into _codpagocomprobante,_codpago,_codcomprobante,_pago,_montopagado;
if ( _fin=1) then
leave ciclo_loop;
end if;

		set _montodeposito=(select monto from pago where codpago=_codpago);

		set _contador=(select count(*) from pagocomprobante where codpago=_codpago
										and codcomprobante!=_codcomprobante and estado=1);


		if(_contador=0) THEN

				update pago set situacionpago=0 where codpago=_codpago;

		ELSE
				
				update pago set situacionpago=1 where codpago=_codpago;


		end if;
			

		/*
		set _montousado=(select sum(montopagado) from pagocomprobante where codpago=_codpago);

		if(_montodeposito=_montousado) THEN

				update pago set situacionpago=0 where codpago=_codpago;

		else
				update pago set situacionpago=1 where codpago=_codpago;
			
		end if;*/

		update pagocomprobante set estado=0 where codpagocomprobante=_codpagocomprobante;

end LOOP ciclo_loop ;
CLOSE lista_pago;




END
;;
DELIMITER ;

