-- ----------------------------
-- Procedure structure for buscacomprobantexcodigo
-- ----------------------------
DROP PROCEDURE IF EXISTS `buscacomprobantexcodigo`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `buscacomprobantexcodigo`(codcomprobante_ int(11))
BEGIN
SELECT 	LPAD(nt.codcomprobante,11,'0') , 
					nt.codtransaccion, 
					tr.sigla, 
					tr.descripcion, 
					nt.codtipocomprobante, 
					td.sigla,
					nt.codserie,
					nt.serie,
					 
					nt.codcliente, 
					IFNULL(cl.dni,''),
					#IFNULL(cl.ruc,""),
					IFNULL(cl.razonsocial,""),
					IFNULL(cl.nombre,""),
					IFNULL(cl.direccion,""), 
					nt.codmoneda, 
					nt.tipocambio, 
					nt.fechaemision, 

					IFNULL(nt.descripcion,""),
					nt.descuento, 
					nt.subtotal, 
					nt.igv, 
					nt.total, 

					nt.formapago, 
					nt.fechapago, 
			
					nt.abonado,
					nt.pendiente,
					IFNULL(nt.codNotaCredito,0),
					IFNULL(nt.documentoreferencia,""),			
					

					
					ROUND(nt.totalgravadas,2) AS gravadas,
					ROUND(nt.totalexoneradas,2) AS exoneradas, 
					ROUND(nt.totalinafectas,2) AS inafectas,
					ROUND(nt.totalgratuitas,2) AS gratuitas,

					nt.codUsuario, 
					nt.fecharegistro,
					nt.estado,
					nt.comprobante,
					nt.codpedido
								
								

  FROM comprobante nt INNER JOIN transaccion tr ON nt.codtransaccion = tr.codTransaccion 
       LEFT OUTER JOIN tipocomprobante td on nt.codtipocomprobante = td.codtipocomprobante
       LEFT OUTER JOIN promotor cl on nt.codcliente = cl.codPromotor
  WHERE nt.codcomprobante = codcomprobante_;
END
;;
DELIMITER ;

