-- ----------------------------
-- Procedure structure for buscar_repositorio
-- ----------------------------
DROP PROCEDURE IF EXISTS `buscar_repositorio`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `buscar_repositorio`(_tipdoc int(11), _serie varchar(255), 
_correlativo varchar(255), _fechaemision date, 
_monto decimal(10,2))
begin 
						SELECT 
										repositorioid,
										tipdoc, 
										IFNULL(fechaemision,"") AS fechaemision,
										serie, 
										correlativo, 
										monto, 
										estadosunat, 
										IFNULL(mensajesunat,"") AS mensajesunat,
										docpdf, 
										docxml, 
										nombredoc, 
										usuario, 
										DATE(fecharegistro) AS fecharegistro

						FROM repositorio 
						WHERE tipdoc=_tipdoc and
									serie=_serie and 
									correlativo=_correlativo and 
									fechaemision=_fechaemision and
									monto=_monto;
end
;;
DELIMITER ;

