-- ----------------------------
-- Procedure structure for buscaticketxcodigo
-- ----------------------------
DROP PROCEDURE IF EXISTS `buscaticketxcodigo`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `buscaticketxcodigo`(codticket_ int(11))
BEGIN
SELECT 		t.codticket, 
					t.codtipocomprobante, 
					s.codserie,
					t.correlativo as correlativo, 
					t.codcliente, 
					IFNULL(cl.documento,""),
					IFNULL(cl.nombreyapellido,''),
					IFNULL(cl.direccion,""), 
					#nt.codmoneda, 
					#nt.tipocambio, 
					t.fecha, 
					t.subtotal, 
					t.igv, 
					t.total, 
					t.codUsuario, 
					t.fecharegistro,
					t.estado
							
  FROM ticket t
       LEFT OUTER JOIN tipocomprobante td on t.codtipocomprobante = td.codtipocomprobante
			 LEFT OUTER JOIN  serie s on s.codtipocomprobante = td.codtipocomprobante
       LEFT OUTER JOIN promotor cl on t.codpromotor = cl.codPromotor
  WHERE t.codticket = codticket_;
END
;;
DELIMITER ;

