CREATE DEFINER=`root`@`localhost` PROCEDURE `busquedadetalleprecio`(codcampana_ int(11))
BEGIN

select 

dp.marca as 'MARCA',
dp.modelo as 'MODELO',
dp.color as 'COLOR',
dp.ppromotor as 'P.PROMOTOR',
dp.pcliente as 'P.CLIENTE',
dp.pdirector as 'P.DIRECTOR',
dp.talladisponible as 'T.DISPONIBLE',
dp.tallaagotada as 'T.AGOTADA',
u.cuenta as 'RESPONSABLE',
