-- ----------------------------
-- Procedure structure for busquedapremio
-- ----------------------------
DROP PROCEDURE IF EXISTS `busquedapremio`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `busquedapremio`(nombre_ varchar(255),codcampana_ int(11))
BEGIN


if(nombre_='')  THEN



select p.codpremio,pro.nombre,pro.dni,c.descripcion,p.comprafacturada,
p.fecha,p.premioregular,p.envioregular,p.premioafil,p.valido,
if(p.entregado=1,'ENTREGADO','NO ENTREGADO') as entregado,
p.estado
from premio p 
inner join promotor pro on (p.codpromotor=pro.codPromotor)
inner join campana c on (p.codcampaña=c.codcampana)
where p.estado=1 and p.codcampaña=codcampana_;


else



select p.codpremio,pro.nombre,pro.dni,c.descripcion,p.comprafacturada,
p.fecha,p.premioregular,p.envioregular,p.premioafil,p.valido,
if(p.entregado=1,'ENTREGADO','NO ENTREGADO') as entregado,
p.estado
from premio p 
inner join promotor pro on (p.codpromotor=pro.codPromotor)
inner join campana c on (p.codcampaña=c.codcampana)
where p.estado=1 and p.codcampaña=codcampana_
and  pro.nombre like  concat(nombre_, '%');


end if;

END
;;
