-- ----------------------------
-- Procedure structure for busquedaproductoxfiltro
-- ----------------------------
DROP PROCEDURE IF EXISTS `busquedaproductoxfiltro`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `busquedaproductoxfiltro`(nombre_ varchar(255), filtro_ varchar(255))
BEGIN


if(nombre_='') then 



	if(filtro_='nuevos') then
	
		select p.codproducto,p.codigosap,p.descripcion2,p.campaña,p.talla
		from producto p
		where p.codigosap=0
		order by p.descripcion2 desc;
	else
		select p.codproducto,p.codigosap,p.descripcion2,p.campaña,p.talla
		from producto p
		where p.codigosap!=0
		order by p.descripcion2 desc;

	end if;

END IF;


if(nombre_!='') then



	if(filtro_='nuevos') then
	
			select p.codproducto,p.codigosap,p.descripcion2,p.campaña,p.talla
			from producto p
			where  p.codigosap=0 and p.descripcion2 like  concat('%',nombre_, '%') 
			order by p.descripcion2 desc;

			

	else
			select p.codproducto,p.codigosap,p.descripcion2,p.campaña,p.talla
			from producto p
			where   p.codigosap!=0 and p.descripcion2 like  concat('%',nombre_,'%') 
			order by p.descripcion2 desc;

	end if;


END IF;


END
;;
DELIMITER ;

