-- ----------------------------
-- Procedure structure for comparacion
-- ----------------------------
DROP PROCEDURE IF EXISTS `comparacion`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `comparacion`(codcampana_ int(11))
BEGIN

declare fecha1 datetime;
declare fecha2 datetime;

set fecha1=(select fechainicio from campana where codcampana=codcampana_);
set fecha2=(select fechafin from campana where codcampana=codcampana_);


select 
p.nombrepromotor,
c.descripcion  as campana,
p.pag,
p.descripcion as producto,
p.marca,
p.modelo,
p.color,
p.categoria,
p.talla,
dp.ppromotor ,
p.totalpreprom2 

FROM  precios pre 
inner join detalleprecios dp on (pre.codprecio=dp.codprecio)
inner join campana c on (pre.codcampana=c.codcampana)
#inner join usuario u on (c.codusuario=u.usuarioid)
inner join  categoria ca on (c.codcategoria=ca.codcategoria)
inner join producto p on (c.descripcion=p.campaña)
where p.marca=dp.marca and p.modelo=dp.modelo and p.color=dp.color and
dp.ppromotor!=p.totalpreprom2 and p.pag=dp.pag
#cast(p.fecharegistro as date) BETWEEN cast(fecha1 as date) and cast(fecha2 as date)
ORDER BY c.descripcion DESC;

END
;;
DELIMITER ;

