-- ----------------------------
-- Procedure structure for guardacomprobante
-- ----------------------------
DROP PROCEDURE IF EXISTS `guardacomprobante`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` PROCEDURE `guardacomprobante`(codpedido_ int(11),
codtransaccion_ int(11),
codtipocomprobante_ int(11),
comprobante_ varchar(30),codserie_ int(11),serie_ varchar(4),
codcliente_ int(11), 
codmoneda_ int(11),tipocambio_  int(11), 
descripcion_ varchar(1000),
fechaemision_ datetime, 
descuento_ decimal(10,2),
subtotal_ decimal(10,2),
igv_ decimal(10,2),
total_ decimal(10,2),
totalgravadas_ decimal(10,2),
totalexoneradas_ decimal(10,2),
totalinafectas_ decimal(10,2),
totalgratuitas_ decimal(10,2),
abonado_ decimal(10,4),
pendiente_ decimal(10,4),
situacionpago_ int(11),
formapago_ int(11),
codusuario_ int(11),
codnotacredito_ int(11),documentoreferencia_ varchar(20) ,coddiscrepancia_ int(11),estadopedido_ int(11),OUT  newid  int(11))
BEGIN

declare _idempresa int(11);
declare _id int(11);
declare _correlativo VARCHAR(1000);
DECLARE existe int(11);

DECLARE comprobant_ varchar(30);

set comprobant_=(
			select CONCAT(serie,'-',LPAD(convert(correlativo , char(1000)),8,'0'))  from serie WHERE codSerie =codserie_ and codtipocomprobante=codtipocomprobante_
	);



				INSERT INTO comprobante
				( codpedido,
					codtransaccion,
					codtipocomprobante,
					comprobante, 
					codserie,
					serie,
					codcliente,
					codmoneda,
					tipocambio,
					descripcion,
					fechaemision,
					descuento, 
					subtotal,
					igv,
					total,
					totalgravadas,
					totalexoneradas,
					totalinafectas,
					totalgratuitas,
					abonado,		
					pendiente,
					situacionpago,
					formapago,
					codusuario,
					fecharegistro,
					estado,
					codNotaCredito,
					documentoreferencia,
					coddiscrepancia
					)
				VALUES
				(	codpedido_,
					codtransaccion_,
					codtipocomprobante_,
					comprobant_, 
					codserie_,
					serie_,
					codcliente_,
					codmoneda_,
					tipocambio_,
					descripcion_,
					fechaemision_,
					descuento_, 
					subtotal_,
					igv_,
					total_,
					totalgravadas_,
					totalexoneradas_,
					totalinafectas_,
					totalgratuitas_,
					abonado_,		
					pendiente_,
					situacionpago_,
					formapago_,
					codusuario_,
					now(), 
					1,
					codnotacredito_,
					documentoreferencia_,
					coddiscrepancia_);
					
					SET newid = LAST_INSERT_ID();

					UPDATE serie SET correlativo = correlativo+1 WHERE codSerie =codserie_
					and codtipocomprobante=codtipocomprobante_;


					if(codtipocomprobante_=1 or codtipocomprobante_=2) then

						update pedido set estado=estadopedido_  
						where codpedido=codpedido_;

						update detallepedido set estado=estadopedido_ 
						where codpedido=codpedido_;

					end if;
					
					if(codnotacredito_<>0) then

						update comprobante set codNotaCredito= newid,documentoreferencia=comprobante_
						where codcomprobante=codnotacredito_;

					end if;

			

				


END
;;
DELIMITER ;

