					subtotal,
					igv,
					total,
					totalgravadas,
					totalexoneradas,
					totalinafectas,
					totalgratuitas,
					abonado,		
					pendiente,
					situacionpago,
					formapago,
					codusuario,
					fecharegistro,
					estado,
					codNotaCredito,
					documentoreferencia,
					coddiscrepancia
					)
				VALUES
				(	codpedido_,
					codtransaccion_,
