						where codcomprobante=codnotacredito_;

						IF(coddiscrepancia_=1) THEN

								update pedido set estado=1 
								where codpedido=codpedido_;

								update detallepedido set estado=1
								where codpedido=codpedido_;


						END IF;

					end if;

			

				


