-- ----------------------------
-- Procedure structure for guardaticket
-- ----------------------------
DROP PROCEDURE IF EXISTS `guardaticket`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `guardaticket`(codcliente_ int(11),
codtipocomprobante_ int(11),
subtotal_ decimal(10,2),
igv_ decimal(10,2),
total_ decimal(10,2),
fecha_ datetime,codempresa_ int(11),
codusuario_ int(11),OUT  newid  int(11))
BEGIN

declare _idempresa int(11);
declare _id int(11);
declare _correlativo VARCHAR(1000);
DECLARE existe int(11);

				INSERT INTO ticket
				( codpromotor,
					codtipocomprobante,
					correlativo,
					subtotal,
					igv, 
					total,
					fecha,
					codempresa,
					fecharegistro,
					codusuario,
					estado)
				VALUES
				(	codcliente_,
					codtipocomprobante_,
					(select CONCAT(serie,'-',LPAD(correlativo+1,'8',0)) from serie where codtipocomprobante=codtipocomprobante_),
					subtotal_,
					igv_, 
					total_,
					fecha_,
					codempresa_,
					now(),
					codusuario_,
					1
					);
					
					SET newid = LAST_INSERT_ID();

					UPDATE serie SET correlativo = correlativo+1 WHERE codtipocomprobante=codtipocomprobante_;

END
;;
DELIMITER ;

