-- ----------------------------
-- Procedure structure for listacobros
-- ----------------------------
DROP PROCEDURE IF EXISTS `listacobros`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `listacobros`(codcomprobante_ int(11))
BEGIN


	select co.codcobro,co.fechacobro,m.descripcion as moneda,co.monto,mp.descripcion as metodo,
	b.descripcion as banco,cu.cuentaCorriente,if(co.codmetodopago='6', (select comprobante from comprobante t where t.codcomprobante=co.codnotacredito),co.noperacion) as noperacion,
	if(co.estado=1,"ACTIVO","ANULADO") as estado,
	c.total,
	usu.cuenta as cuenta
	from comprobante c
	inner join cobro co on (c.codcomprobante=co.codcomprobante)
  left join moneda m on (c.codMoneda=m.codMoneda)
	left join metodopago mp on (co.codmetodopago=mp.codMetodoPago)
  left join banco b on (co.codbanco=b.codBanco)
	left join ctacte cu on (co.codcuenta=cu.codCuentaCorriente)
	left join usuario usu on (usu.usuarioid=co.codusuario)
	where co.codcomprobante=codcomprobante_;
	



END
;;
DELIMITER ;

