left join tipo_documento_identidad tc on (p.coddocumentoidentidad=tc.idtipodocumentoidentidad)
where p.email!='' and upper(p.email)  in 
   (
    SELECT upper(email)
    FROM promotor
	  where email!=''
    GROUP BY upper(email)
    HAVING count(upper(email)) >1
    )
order by email asc;





END
;;
DELIMITER ;

