DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `listardetallepedidofiltro`(codpedido_ int(11))
BEGIN

declare _fin int(11) DEFAULT 0;
declare v_coddetallepedido int(11);

declare contador int(11);
declare cont int(11);
declare descrip varchar(255);
declare tal varchar(255);
declare catal varchar(255);
declare color int(11);
declare coddet int(11);
declare cantidad int(11);

declare lista_item cursor for 
select	det.coddetallepedido from  pedido p inner join detallepedido det on (p.codpedido=det.codpedido)
where p.codpedido=codpedido_;
#and p.estado=1;

DECLARE CONTINUE HANDLER FOR  NOT FOUND SET _fin=1;

CREATE TEMPORARY TABLE IF NOT EXISTS detallepedidotemporal (
     coddetallepedido int(11) 
	 , codpedido int(11)
	 , codproducto int(11)
   , producto varchar(255)  NULL 
   , catalogo varchar(255) NULL 
   , devolucion int(11)
   , talla varchar(255) NULL
   , cantidad int(11) NULL 
   , precio decimal(10,2) NULL
   , preciost decimal(10,2) NULL 
	 , codusuario int(11) null
   , fecharegistro datetime null
	 , estado int(1) null
   , color int(11) NULL
);

open lista_item;
ciclo_loop: LOOP
fetch lista_item into v_coddetallepedido;
if ( _fin=1) then
leave ciclo_loop;
end if;
						
						set cantidad=(select	det.cantidad from  pedido p inner join detallepedido det on (p.codpedido=det.codpedido)
													 where det.coddetallepedido=v_coddetallepedido and p.codpedido=codpedido_);

						if(cantidad<=0) THEN
										set color =0;

										insert into detallepedidotemporal
					
										select	det.*,color from  pedido p inner join detallepedido det on (p.codpedido=det.codpedido)
										where det.coddetallepedido=v_coddetallepedido and p.codpedido=codpedido_;

						ELSE

									set descrip=(select	det.producto from  pedido p inner join detallepedido det on (p.codpedido=det.codpedido)
													 where det.coddetallepedido=v_coddetallepedido and p.codpedido=codpedido_);

									set tal=(select	det.talla from  pedido p inner join detallepedido det on (p.codpedido=det.codpedido)
												where det.coddetallepedido=v_coddetallepedido and p.codpedido=codpedido_);

									set catal=(select	det.catalogo from  pedido p inner join detallepedido det on (p.codpedido=det.codpedido)
												where det.coddetallepedido=v_coddetallepedido and p.codpedido=codpedido_);

									set contador=(select count(*) from producto where descripcion2=descrip and talla=tal and campaña=catal);

									if(contador=0) then 
										set color=2;

										insert into detallepedidotemporal
					
										select	det.*,color from  pedido p inner join detallepedido det on (p.codpedido=det.codpedido)
										where det.coddetallepedido=v_coddetallepedido and p.codpedido=codpedido_;

								 else

									

										set cont=(select	count(*) from  pedido p inner join detallepedido det on (p.codpedido=det.codpedido)
										inner join producto pro on (pro.codproducto=det.codproducto)
										where det.coddetallepedido=v_coddetallepedido
										and det.precio != (select dp.ppromotor from  precios pre
																				 inner join detalleprecios dp on (pre.codprecio=dp.codprecio)
																				 inner join campana c on (c.codcampana=pre.codcampana)
																				 where  pro.pag=dp.pag and pro.marca=dp.marca AND
																								pro.modelo=dp.modelo and pro.color=dp.color AND
																								det.catalogo=c.descripcion limit 1));


									 if(cont>0) THEN
											set color =1;

											insert into detallepedidotemporal
					
											select	det.*,color from  pedido p inner join detallepedido det on (p.codpedido=det.codpedido)
											where det.coddetallepedido=v_coddetallepedido and p.codpedido=codpedido_;
									 else
											set color =0;

											insert into detallepedidotemporal
					
											select	det.*,color from  pedido p inner join detallepedido det on (p.codpedido=det.codpedido)
											where det.coddetallepedido=v_coddetallepedido and p.codpedido=codpedido_;
									
									end if;
							end if;
				end if;

end LOOP ciclo_loop ;
CLOSE lista_item;

select * from detallepedidotemporal;
DROP TEMPORARY TABLE IF EXISTS detallepedidotemporal;

END
;;
DELIMITER ;

