-- ----------------------------
-- Procedure structure for listarpagofechaoperacion
-- ----------------------------
DROP PROCEDURE IF EXISTS `listarpagofechaoperacion`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `listarpagofechaoperacion`(numerooperacion_ varchar(255),
codbanco_ int(11),
codcuenta_ int(11),
 fechai_ datetime,
 fechaf_ datetime)
BEGIN



if(numerooperacion_='') then


select p.codpago,p.codbanco,p.codcuenta,b.descripcion as banco,c.cuentaCorriente,p.fecha,p.fechavaluta,p.descripcion,p.monto,p.cobrado,p.saldofavor,p.saldo,p.sucursal,p.operacionnumero,
p.operacionhora,p.usuario,p.utc,u.nombresapellidos as responsable,p.estado,p.fecharegistro

from  pago p 
inner join banco b on (p.codbanco=b.codbanco)
inner join ctacte c on (p.codcuenta=c.codCuentaCorriente)
inner join usuario u on (u.usuarioid=p.codusuario)
where p.codbanco=codbanco_ and p.codcuenta=codcuenta_
and cast(p.fecha as date)>= cast(fechai_ as date) and cast(p.fecha as date) <=cast(fechaf_ as date) and p.estado=1
and p.situacionpago in (0,1);

else


select p.codpago,p.codbanco,p.codcuenta,b.descripcion as banco,c.cuentaCorriente,p.fecha,p.fechavaluta,p.descripcion,p.monto,p.cobrado,p.saldofavor,p.saldo,p.sucursal,p.operacionnumero,
p.operacionhora,p.usuario,p.utc,u.nombresapellidos as responsable,p.estado,p.fecharegistro

from  pago p 
inner join banco b on (p.codbanco=b.codbanco)
inner join ctacte c on (p.codcuenta=c.codCuentaCorriente)
inner join usuario u on (u.usuarioid=p.codusuario)
where p.codbanco=codbanco_ and p.codcuenta=codcuenta_
and p.operacionnumero like concat(numerooperacion_,'%')
and cast(p.fecha as date)>= cast(fechai_ as date) and cast(p.fecha as date) <=cast(fechaf_ as date) and p.estado=1 
and p.situacionpago in (0,1);

end if;

END
;;
DELIMITER ;

