inner join usuario u on (u.usuarioid=p.codUsuario)
where p.estado=1 and pro.codPromotor=codpromotor_ and 
cast(p.fechapedido as DATE)>= cast(fechai_ as DATE) and CAST(p.fechapedido AS DATE)<= cast(fechaf_ as DATE);
#and p.codpedido not in (select codpedido from comprobante where estado=1)
#and p.estado in (1,2);

ELSE


select p.codpedido,p.numeropedido, pro.nombre,p.subtotal,p.igv,p.total,p.fechapedido,
p.fecharegistro,u.nombresapellidos,
case p.estado when 0  then 'ANULADO' WHEN 1  then 'ACTIVO' WHEN   2  then 'FACTURADO'   end as estado
from pedido p
inner join promotor pro on (p.codpromotor=pro.codPromotor)
inner join usuario u on (u.usuarioid=p.codUsuario)
where p.estado=1 and pro.codPromotor=codpromotor_ and 
cast(p.fechapedido as DATE)>= cast(fechai_ as DATE) and CAST(p.fechapedido AS DATE)<= cast(fechaf_ as DATE)
and p.codpedido not in (select codpedido from comprobante where estado=1)
and pro.nombre like  concat(filtro_, '%')
and p.estado in (1,2);




END IF;



END
;;
DELIMITER ;

