-- ----------------------------
-- Procedure structure for listar_detalle_comprobante_xidcomprobante
-- ----------------------------
DROP PROCEDURE IF EXISTS `listar_detalle_comprobante_xidcomprobante`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `listar_detalle_comprobante_xidcomprobante`(in _idcomprobante int(11))
BEGIN

select c.codcomprobante,
dc.codDetalleComprobante,
CONVERT(1, UNSIGNED) as idimpuesto, 
dc.tipoimpuesto as codsunat,
dc.codproducto,
p.descripcion2 as producto,
p.campaña as catalogo,
p.talla,
dc.cantidad,
dc.preciounitario,
round(dc.cantidad*dc.preciounitario,2) as importe,
dc.subtotal as valorventa,
dc.igv as igv,
dc.total as precioventa,
um.sigla  as unidadmedida,
case dc.tipoimpuesto when 10 then 'GRAVADO'
WHEN 20 THEN 'EXONERADO'
WHEN 30 THEN 'INAFECTO'
WHEN 21 THEN 'GRATUITA'
END as tipoimpuesto,
c.codusuario,
c.estado,
c.fecharegistro,
um.codUnidadMedida,
dc.tipoimpuesto as codtipoimpuesto



 from comprobante c 
inner join detallecomprobante dc on (c.codcomprobante=dc.codcomprobante)
inner join unidadmedida um on (dc.unidadingresada=um.codUnidadMedida)
inner join producto p on (dc.codproducto=p.codproducto)
where c.codcomprobante= _idcomprobante;

end
;;
DELIMITER ;

