-- ----------------------------
-- Procedure structure for listar_movimiento_caja
-- ----------------------------
DROP PROCEDURE IF EXISTS `listar_movimiento_caja`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `listar_movimiento_caja`(in _cajaid int(11), in _estado int(11))
begin


select codcaja,0 as codcobro,'APERTURA DE CAJA' as concepto, ROUND(montoapertura,2) as monto ,'CAJA' as descripcion,
fechaapertura as fechacobro,'SD' as nombre ,'' as comprobante, ROUND(montoapertura ,2) as total,'' as tipocobro,'' as noperacion,
'' as observacion,'' as razonsocial
from caja
where codcaja=_cajaid
UNION all
select ca.codcaja, codcobro, 'COBRO DE VENTA' as concepto,
ROUND(co.monto,2) as monto, op.descripcion, 
co.fechacobro, tcc.nombre as nombre,
com.comprobante as comprobante, ROUND(com.total,2) as total,
tco.descripcion as tipocobro, co.noperacion, co.observacion,
cli.nombre as razonsocial
from caja ca, cobro co, transaccion op,
serie tc, comprobante com, metodopago tco, promotor cli,tipocomprobante tcc
where co.codcaja=ca.codcaja 
and co.codcomprobante=com.codcomprobante
and co.codmetodopago=tco.codMetodoPago
and com.codtransaccion=op.codTransaccion
and com.codcliente=cli.codPromotor
and com.codserie=tc.codSerie
and com.codtipocomprobante=tcc.codtipocomprobante
and ca.codcaja=_cajaid
and ca.estado= _estado
and co.estado=1;

end
;;
