-- ----------------------------
-- Procedure structure for listar_notas_xestado_xfecha
-- ----------------------------
DROP PROCEDURE IF EXISTS `listar_notas_xestado_xfecha`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `listar_notas_xestado_xfecha`(in _fechainicio date,
in _fechafin date,
in _estado int(11))
begin
select c.codcomprobante,
cl.nombre,
DATE_FORMAT(c.fechaemision, "%d/%m/%Y") as fechaemision,
c.comprobante,
c.codmoneda,
mo.descripcion,
ROUND(c.total,2) as total,
(case
when  c.estado=1 then 
	'REGISTRADO'
when  c.estado=2 then 
	'APLICADA'
when  c.estado=0 then 
	'ANULADO'
end) as estado,
c.documentoreferencia,
usu.cuenta as responsable
from comprobante c
INNER JOIN promotor cl on c.codcliente=cl.codPromotor
INNER JOIN moneda mo on c.codmoneda=mo.codMoneda
left join usuario usu on (usu.usuarioid=c.codusuario)
where cast(c.fechaemision as date)>= cast(_fechainicio as date)  and cast(c.fechaemision as date)<=cast(_fechafin as date)
#where c.fechaemision BETWEEN _fechainicio and _fechafin
and c.estado=_estado and c.codtipocomprobante not in(1,2);
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for listar_repositorio
-- ----------------------------
DROP PROCEDURE IF EXISTS `listar_repositorio`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `listar_repositorio`(_estadosunat varchar(255), _codSucursal int(11), _codAlmacen int(11), _fecharegistro datetime)
begin 

			select 	repositorioid, tipdoc, fechaemision, 	
							serie,
							/*
							(CASE tipdoc 
								WHEN 1 THEN CONCAT("B", serie)
								WHEN 2 THEN CONCAT("F", serie)
								WHEN 4 THEN CONCAT("B", serie)
								END) as serie,*/
							correlativo, monto,							
							(CASE estadosunat 
								WHEN -1 THEN "No Enviado"
								WHEN 0 THEN "Si Enviado"
								END) as estadosunat,
							IFNULL(mensajesunat,"") AS mensajesunat, docpdf, docxml, nombredoc, usuario, fecharegistro, fechaactualiza
			from repositorio 
			where  estadosunat=_estadosunat
			AND codSucursal = _codSucursal
			AND codAlmacen = _codAlmacen
			AND DATE(fecharegistro) = DATE(_fecharegistro) LIMIT 50;
end
;;
DELIMITER ;

