-- ----------------------------
-- Procedure structure for listar_ticket_xestado_xfecha
-- ----------------------------
DROP PROCEDURE IF EXISTS `listar_ticket_xestado_xfecha`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `listar_ticket_xestado_xfecha`(in fechainicio_ date,
in fechafin_ date)
begin

select t.codticket,
cl.nombreyapellido,
DATE_FORMAT(t.fecha, "%d/%m/%Y") as fecha,
t.correlativo as documento,
t.total as total,
if(t.estado=1,'REGISTRADO','ANULADO') as estado,
cl.documento as docidentidad,
u.cuenta
from ticket t
INNER JOIN promotor cl on t.codpromotor=cl.codPromotor
INNER JOIN tipocomprobante tc on (t.codtipocomprobante=tc.codtipocomprobante)
INNER JOIN serie s on (t.codtipocomprobante=s.codtipocomprobante)
inner join usuario u on(t.codusuario=u.usuarioid)
where cast(t.fecha as date)>= cast(fechainicio_ as date) and cast(t.fecha as date)<=cast(fechafin_ as date);
end
;;
