-- ----------------------------
-- Procedure structure for listar_ticket_xestado_xfecha_xcliente
-- ----------------------------
DROP PROCEDURE IF EXISTS `listar_ticket_xestado_xfecha_xcliente`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `listar_ticket_xestado_xfecha_xcliente`(in fechainicio_ date,
in fechafin_ date, in cliente_ varchar(255))
begin
select t.codticket,
cl.nombreyapellido,
DATE_FORMAT(c.fecha, "%d/%m/%Y") as fecha,
t.correlativo as documento,
t.total as total,
if(c.estado=1,'REGISTRADO','ANULADO') as estado,
cl.documento as docidentidad,
u.cuenta

from ticket t
INNER JOIN promotor cl on t.codpromotor=cl.codPromotor
INNER JOIN tipocomprobante tc on (t.codtipocomprobante=tc.codtipocomprobante)
INNER JOIN serie s on (t.codtipocomprobante=s.codtipocomprobante)
inner join usuario u on(t.codusuario=u.usuarioid)
where cast(t.fecha as date)>= cast(fechainicio_ as date) and cast(t.fecha as date)<=cast(fechafin_ as date)
and cl.nombreyapellido like concat('%',cliente_,'%');
end
;;
DELIMITER ;

