-- ----------------------------
-- Procedure structure for listar_ventas_xestado_xfecha
-- ----------------------------
DROP PROCEDURE IF EXISTS `listar_ventas_xestado_xfecha`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `listar_ventas_xestado_xfecha`(in fechainicio_ date,
in fechafin_ date)
begin
select c.codcomprobante,
c.codpedido as codpedido,
cl.nombre,
DATE_FORMAT(c.fechaemision, "%d/%m/%Y") as fechaemision,
c.comprobante,
c.codmoneda,
mo.descripcion,
ROUND(c.total,2) as total,
if(c.estado=1,'REGISTRADO','ANULADO') as estado,
cl.dni,
usu.cuenta as responsable
from comprobante c
inner join pedido p on (c.codpedido=p.codpedido)
INNER JOIN promotor cl on c.codcliente=cl.codPromotor
INNER JOIN moneda mo on c.codmoneda=mo.codMoneda
INNER JOIN tipocomprobante tc on (c.codtipocomprobante=tc.codtipocomprobante)
left join usuario usu on (usu.usuarioid=c.codusuario)
where cast(c.fechaemision as date)>= cast(fechainicio_ as date) and cast(c.fechaemision as date)<=cast(fechafin_ as date)
and tc.codtipocomprobante  in(1,2);
end
;;
DELIMITER ;

