DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `ListaTipoCambios`(mes int(1), año int(4))
BEGIN
#Routine body goes here...
SELECT t.*,m.descripcion
FROM tipocambio t
LEFT OUTER JOIN moneda m on t.codMoneda=m.codMoneda
WHERE MONTH(t.fecha)= mes AND YEAR(t.fecha) = año AND t.estado = 1
ORDER BY t.fecha DESC ;
END
;;
DELIMITER ;

