-- ----------------------------
-- Procedure structure for MuestraCobros
-- ----------------------------
DROP PROCEDURE IF EXISTS `MuestraCobros`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `MuestraCobros`(filtro_ int(11), fecha1_ datetime, fecha2_ datetime, codpromotor_ int(11))
BEGIN

		if(codpromotor_=0 and filtro_=0) THEN

			select c.codcomprobante,c.comprobante ,cast(c.fechaemision as date) as fechaemision,p.nombre,p.dni,
			m.descripcion,c.total,c.pendiente,
		  "Ingresar Pago" AS accion,
			c.abonado
			from comprobante c
			inner join promotor p on (c.codcliente=p.codPromotor)
			inner join moneda m on (c.codmoneda=m.codMoneda)
			where c.situacionpago in (0,1) and
			cast(c.fechaemision as date) >=fecha1_ and cast(c.fechaemision as date) <=fecha2_
			and c.estado=1 and c.codtipocomprobante in (1,2);
		
		end if;

		if(codpromotor_=0 and filtro_=1) THEN

			select c.codcomprobante,c.comprobante ,cast(c.fechaemision as date) as fechaemision,p.nombre,p.dni,
			m.descripcion,c.total,c.pendiente,
			"Muestra Pagos" AS accion,
			c.abonado
			from comprobante c
			inner join promotor p on (c.codcliente=p.codPromotor)
			inner join moneda m on (c.codmoneda=m.codMoneda)
			where c.situacionpago=2 and
			cast(c.fechaemision as date) >=fecha1_ and cast(c.fechaemision as date) <=fecha2_
			and c.codtipocomprobante in (1,2);
			
		
		end if;
	
		if(codpromotor_!=0 and filtro_=0) THEN

			select c.codcomprobante,c.comprobante ,cast(c.fechaemision as date) as fechaemision,p.nombre,p.dni,
			m.descripcion,c.total,c.pendiente,
			"Ingresar Pago" AS accion,
		  c.abonado
			from comprobante c
			inner join promotor p on (c.codcliente=p.codPromotor)
			inner join moneda m on (c.codmoneda=m.codMoneda)
			where c.situacionpago in (0,1) and
			cast(c.fechaemision as date) >=fecha1_ and cast(c.fechaemision as date) <=fecha2_
			and p.codpromotor=codpromotor_
			and c.estado=1 and c.codtipocomprobante in (1,2);
			
			
		end if;

	
		if(codpromotor_!=0 and filtro_=1) THEN

			select c.codcomprobante,c.comprobante ,cast(c.fechaemision as date) as fechaemision,p.nombre,p.dni,
			m.descripcion,c.total,c.pendiente,
			"Muestra Pagos" AS accion,
			c.abonado
			from comprobante c
			inner join promotor p on (c.codcliente=p.codPromotor)
			inner join moneda m on (c.codmoneda=m.codMoneda)
			where c.situacionpago=2 and
			cast(c.fechaemision as date) >=fecha1_ and cast(c.fechaemision as date) <=fecha2_
			and p.codpromotor=codpromotor_ and c.estado=1
			and c.codtipocomprobante in (1,2);
			
		end if;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for MuestraDepositos
-- ----------------------------
DROP PROCEDURE IF EXISTS `MuestraDepositos`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `MuestraDepositos`(filtro_ int(11), fecha1_ datetime, fecha2_ datetime, codpromotor_ int(11))
BEGIN

		if(codpromotor_=0 and filtro_=0) THEN

			select 0 as codpagocomprobante, p.codpago ,p.fecha ,b.descripcion as banco,cu.cuentaCorriente as cuenta, p.descripcion as transacion,p.monto, p.operacionnumero,p.operacionhora,p.sucursal,p.usuario,
			0 as montopagado, 0 as montofavor,
			usu.cuenta as responsable,
			"" AS accion
			from pago p
			left join banco b on (p.codbanco=b.codBanco)
			left join ctacte cu on (p.codcuenta=cu.codCuentaCorriente)
			left join usuario usu on (usu.usuarioid=p.codusuario)
			where cast(p.fecha as date) >=fecha1_ and cast(p.fecha as date) <=fecha2_ and p.estado=1
			and p.codpago not in (select codpago from pagocomprobante where estado=1) ;
		
		end if;

		if(codpromotor_=0 and filtro_=1) THEN

			select pc.codpagocomprobante, p.codpago ,p.fecha ,b.descripcion as banco,cu.cuentaCorriente as cuenta, p.descripcion as transacion,p.monto, p.operacionnumero,p.operacionhora,p.sucursal,p.usuario ,
			pc.montopagado, pc.montofavor,
			usu.cuenta as responsable,
			"Imprimir" AS accion
			from pago p
			left join banco b on (p.codbanco=b.codBanco)
			left join ctacte cu on (p.codcuenta=cu.codCuentaCorriente)
			inner join pagocomprobante pc on (p.codpago=pc.codpago)
		  left join usuario usu on (usu.usuarioid=pc.codusuario)
			where cast(p.fecha as date) >=fecha1_ and cast(p.fecha as date) <=fecha2_ and p.estado=1 and p.situacionpago!=2 and pc.estado=1
			and p.codpago  in (select codpago from pagocomprobante where estado=1) ;
			
		
		end if;

		if(codpromotor_=0 and filtro_=2) THEN

			select  0 as codpagocomprobante, p.codpago ,p.fecha ,b.descripcion as banco,cu.cuentaCorriente as cuenta, p.descripcion as transacion,p.monto, p.operacionnumero,p.operacionhora,p.sucursal,p.usuario,
			0 as montopagado, 0 as montofavor,
			usu.cuenta as responsable,
			"" AS accion
			from pago p
			left join banco b on (p.codbanco=b.codBanco)
			left join ctacte cu on (p.codcuenta=cu.codCuentaCorriente)
			left join usuario usu on (usu.usuarioid=p.codusuario)
			where cast(p.fecha as date) >=fecha1_ and cast(p.fecha as date) <=fecha2_ and p.estado=1 and p.situacionpago=2
			and p.codpago  in (select codpago from pagocomprobante where estado=1) ;
			
		
		end if;

		if(codpromotor_=0 and filtro_=4) THEN

			select  0 as codpagocomprobante, p.codpago ,p.fecha ,b.descripcion as banco,cu.cuentaCorriente as cuenta, p.descripcion as transacion,p.monto, p.operacionnumero,p.operacionhora,p.sucursal,p.usuario,
			0 as montopagado, 0 as montofavor,
			usu.cuenta as responsable,
			"" AS accion
			from pago p
			left join banco b on (p.codbanco=b.codBanco)
			left join ctacte cu on (p.codcuenta=cu.codCuentaCorriente)
			left join usuario usu on (usu.usuarioid=p.codusuario)
			where cast(p.fecha as date) >=fecha1_ and cast(p.fecha as date) <=fecha2_ and p.estado=0
		  and p.codpago  not in (select codpago from pagocomprobante where estado=1);
			
		end if;
	
		if(codpromotor_!=0 and filtro_=1) THEN

			select pc.codpagocomprobante, p.codpago ,p.fecha ,b.descripcion as banco,cu.cuentaCorriente as cuenta, p.descripcion as transacion,p.monto, p.operacionnumero,p.operacionhora,p.sucursal,p.usuario ,
			pc.montopagado, pc.montofavor,
			usu.cuenta as responsable,
			"Imprimir" AS accion
			from pago p
			left join banco b on (p.codbanco=b.codBanco)
			left join ctacte cu on (p.codcuenta=cu.codCuentaCorriente)
			inner join pagocomprobante pc on (p.codpago=pc.codpago)
			inner join comprobante c on (c.codcomprobante=pc.codcomprobante)
			left join usuario usu on (usu.usuarioid=pc.codusuario)
			where cast(p.fecha as date) >=fecha1_ and cast(p.fecha as date) <=fecha2_ and p.estado=1 and p.situacionpago!=2 and pc.estado=1
			and c.codcliente=codpromotor_ and p.codpago  in (select codpago from pagocomprobante where estado=1) ;
			
			
		end if;

	
		if(codpromotor_!=0 and filtro_=2) THEN

			select  0 as codpagocomprobante, p.codpago ,p.fecha ,b.descripcion as banco,cu.cuentaCorriente as cuenta, p.descripcion as transacion,p.monto, p.operacionnumero,p.operacionhora,p.sucursal,p.usuario,
			0 as montopagado, 0 as montofavor,
			usu.cuenta as responsable,
			"" AS accion
			from pago p
			left join banco b on (p.codbanco=b.codBanco)
			left join ctacte cu on (p.codcuenta=cu.codCuentaCorriente)
			inner join pagocomprobante pc on (p.codpago=pc.codpago)
			inner join comprobante c on (c.codcomprobante=pc.codcomprobante)
			left join usuario usu on (usu.usuarioid=pc.codusuario)
			where cast(p.fecha as date) >=fecha1_ and cast(p.fecha as date) <=fecha2_ and p.estado=1 and p.situacionpago=2
			and c.codcliente=codpromotor_ and p.codpago  in (select codpago from pagocomprobante where estado=1) ;
			end if;


END
;;
DELIMITER ;

