-- ----------------------------
-- Procedure structure for registar_igv
-- ----------------------------
DROP PROCEDURE IF EXISTS `registar_igv`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `registar_igv`(
in _valor decimal(10,4),
in _valorinverso decimal(10,4),
in _anho int(11),
in _estado int(11)
)
BEGIN

DECLARE _igvid decimal(10,4) default 0;
set _igvid=IFNULL((select igvid from igv where anho=_anho),0);

if(_igvid=0)then
	INSERT into igv(
	valor,
	valorinverso,
	anho,
	estado,
	fecharegistro
	)
	values(
	_valor,
	_valorinverso,
	_anho,
	_estado,
	NOW()
	);
set _igvid=(SELECT LAST_INSERT_ID());
ELSE 
set _igvid=-1;
end if;
select _igvid as _id;
END
;;
DELIMITER ;

