-- ----------------------------
-- Procedure structure for registrar_cobro
-- ----------------------------
DROP PROCEDURE IF EXISTS `registrar_cobro`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `registrar_cobro`(in _fechacobro date,
in _comprobanteid int(11),
in _tipocobroid int(11),
in _tarjetaid int(11),
in _bancoid int(11),
in _cuentaid int(11),
in _noperacion varchar(1000),
in _notacreditoid int(11),
in _monto DECIMAL(10,4),in _cajaid int(11),
in _observacion VARCHAR(1000),
in _estado int(11),in _codusuario int(11))
BEGIN
declare _monto_cancelado DECIMAL(10,4) default 0;
declare _monto_total DECIMAL(10,4) default 0;
declare id int(11) default 0;
declare _idcajamov int(11) default 0;
declare _concepto varchar(1000);


INSERT INTO cobro(
fechacobro,
codcomprobante,
codmetodopago,
codtipotarjeta,
codbanco,
codcuenta,
noperacion,
codnotacredito,
monto,
observacion,
codcaja,
estado,
fecharegistro,
codusuario
)VALUE(
_fechacobro,
_comprobanteid,
_tipocobroid,
_tarjetaid,
_bancoid,
_cuentaid,
_noperacion,
_notacreditoid,
_monto,
_observacion,
_cajaid,
_estado,
now(),
_codusuario
);

set id =(select LAST_INSERT_ID());

set _concepto='COBRO DE VENTA';

insert into cajamovimiento(
codcaja,
codcobro,
concepto,
monto,
estado,
fecharegistro
)values(
_cajaid,
id,
_concepto,
_monto,
1,
NOW()
);

set _idcajamov=(SELECT LAST_INSERT_ID());



case _tipocobroid
when 1 then 
  update caja set totalefectivo=totalefectivo+_monto, totaldisponible=totaldisponible+_monto where codcaja=_cajaid;
when 2 THEN
	update caja set totaldeposito=totaldeposito+_monto where codcaja=_cajaid;
when 3 THEN
	update caja set totaltarjeta=totaltarjeta+_monto where codcaja=_cajaid;
when 4 THEN
	update caja set totaltransferencia=totaltransferencia+_monto where codcaja=_cajaid;
when 5 THEN
	update caja set totaltarjeta=totaltarjeta+_monto where codcaja=_cajaid;
when 6 THEN
	update caja set totalnotacredito=totalnotacredito+_monto where codcaja=_cajaid;
	update comprobante set estado=2 WHERE codcomprobante=_notacreditoid;
end case;


		update comprobante 
		set abonado=IFNULL(abonado,0)+_monto,pendiente=pendiente-_monto,
		fechapago=_fechacobro where codcomprobante=_comprobanteid;

	  set _monto_cancelado=ifnull((select abonado from comprobante where codcomprobante=_comprobanteid ),0);
	  set _monto_total=ifnull((select total from comprobante where codcomprobante=_comprobanteid ),0);

		if(_monto_cancelado=_monto_total)then # 0 pago pendiente ,1 parcial, estado 2 pago total

			update comprobante set situacionpago=2 where codcomprobante=_comprobanteid;

		ELSE

			update comprobante set situacionpago=1 where codcomprobante=_comprobanteid;

		end if;

select id  as _id;




END
;;
DELIMITER ;

