-- ----------------------------
-- Procedure structure for ReporteDocumentosElectronicosEnviados
-- ----------------------------
DROP PROCEDURE IF EXISTS `ReporteDocumentosElectronicosEnviados`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` PROCEDURE `ReporteDocumentosElectronicosEnviados`(in fechainicio_ date,
in fechafin_ date, in codigo_documento int(11))
begin


if(codigo_documento=1) THEN

select c.codcomprobante,
c.codpedido as codpedido,
cl.nombre,
DATE_FORMAT(c.fechaemision, "%d/%m/%Y") as fechaemision,
c.comprobante,
c.codmoneda,
mo.descripcion,
ROUND(c.total,2) as total,
cl.dni,
'' as documentoreferencia,
fechainicio_ as fecha1,
fechafin_ as fecha2
from comprobante c
inner join repositorio r on (c.codcomprobante=r.codFacturaVenta)
INNER JOIN promotor cl on c.codcliente=cl.codPromotor
INNER JOIN moneda mo on c.codmoneda=mo.codMoneda
INNER JOIN tipocomprobante tc on (c.codtipocomprobante=tc.codtipocomprobante)
where r.tipdoc=1 
and 
cast(c.fechaemision as date)>= cast(fechainicio_ as date) and cast(c.fechaemision as date)<=cast(fechafin_ as date)
and r.estadosunat=0;


end if;


if(codigo_documento=2) THEN

select c.codcomprobante,
c.codpedido as codpedido,
cl.nombre,
DATE_FORMAT(c.fechaemision, "%d/%m/%Y") as fechaemision,
c.comprobante,
c.codmoneda,
mo.descripcion,
ROUND(c.total,2) as total,
cl.dni,
'' as documentoreferencia,
fechainicio_ as fecha1,
fechafin_ as fecha2
from comprobante c
inner join repositorio r on (c.codcomprobante=r.codFacturaVenta)
INNER JOIN promotor cl on c.codcliente=cl.codPromotor
INNER JOIN moneda mo on c.codmoneda=mo.codMoneda
INNER JOIN tipocomprobante tc on (c.codtipocomprobante=tc.codtipocomprobante)
where r.tipdoc=2 
and 
cast(c.fechaemision as date)>= cast(fechainicio_ as date) and cast(c.fechaemision as date)<=cast(fechafin_ as date)
and r.estadosunat=0;


end if;

if(codigo_documento=3) THEN

select c.codcomprobante,
cl.nombre,
DATE_FORMAT(c.fechaemision, "%d/%m/%Y") as fechaemision,
c.comprobante,
c.codmoneda,
mo.descripcion,
ROUND(c.total,2) as total,
cl.dni,
c.documentoreferencia,
fechainicio_ as fecha1,
fechafin_ as fecha2
from comprobante c
inner join repositorio r on (c.codcomprobante=r.codFacturaVenta)
INNER JOIN promotor cl on c.codcliente=cl.codPromotor
INNER JOIN moneda mo on c.codmoneda=mo.codMoneda
where r.tipdoc=4 
and cast(c.fechaemision as date)>= cast(fechainicio_ as date)  and cast(c.fechaemision as date)<=cast(fechafin_ as date)
and r.estadosunat=0;

end if;



end
;;
DELIMITER ;

