DROP PROCEDURE IF EXISTS `ReporteFactura2`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` PROCEDURE `ReporteFactura2`(codcomprobante_ int(11))
BEGIN

DECLARE grecia BLOB;
	
				SELECT   dc.codproducto AS det_codProducto,
								#p.referencia AS det_referencia,
								IF(co.codtransaccion = 5,CONCAT(p.descripcion, " - ", "PAGO POR ANTICIPO"), concat(p.descripcion2,' TALLA ',p.talla)) AS det_descripcionPrd,
								dc.unidadingresada AS det_codUnidadMedida,
								u.sigla AS det_sigla,
								dc.cantidad AS det_cantidad, 
								dc.preciounitario AS det_preciounitario,
								dc.subtotal AS det_importe,
								dc.igv AS det_igv,
								dc.total AS det_total,
								dc.descuento1 AS det_montodscto,
								#dp.valorpromedio AS det_valorpromedio,
                
								pro.codPromotor AS cli_codCliente,
								#c.codigopersonalizado AS cli_codigopersonalizado,
								IF(co.codtipocomprobante=1,pro.nombre, pro.razonsocial)as cli_nombrerazon, 
								#IF(co.codtipocomprobante=1,pro.dni, c.ruc)as cli_dniruc,
								pro.dni as cli_dniruc,
								co.codtipocomprobante,
								pro.direccion AS cli_direccionlegal,
								#c.comentario AS cli_comentario,
								#"z.codZona AS cli_codZona,
								#"z.descripcion as cli_Zona, 

								#c.codVendedor AS ven_codVendedor, 
								#v.nombre AS ven_vendedores, 
								co.formapago  AS ven_formapago, 

								fp.descripcion AS venta_condicion, 
								CONCAT(DATE_FORMAT(co.fechaemision, '%Y-%m-%d'),' ',DATE_FORMAT(co.fecharegistro,'%H:%i:%s')) AS venta_Emision, 
								(co.total-co.igv) as venta_bruto, 
								co.igv AS venta_igv, 
								co.total AS venta_total, 
								co.codusuario AS venta_codUsuario,
								co.fechapago AS venta_fecharegistro,
								s.serie AS venta_serie, 
								mon.descripcion AS venta_moned,
								#IF(pv.tipoventa,"G","E")AS venta_tipo,
								co.comprobante as venta_numDocumento,
								/*
								(CASE pv.codTipoDocumento 
								WHEN 1 THEN CONCAT("B",pv.serie," - ", LPAD(pv.numDocumento,8,0) )
								WHEN 2 THEN CONCAT("F",pv.serie," - ", LPAD(pv.numDocumento,8,0) )
								END) as venta_numDocumento,*/
								co.totalgravadas AS venta_gravadas,
								co.totalexoneradas AS venta_exoneradas,
								co.totalgratuitas AS venta_gratuitas,
								co.totalinafectas AS venta_inafectas,
								IF(co.codtipocomprobante = 2,"FACTURA ELECTRÓNICA","BOLETA ELECTRÓNICA") AS nombredocumento,
									
								
								(select razonsocial from empresa) AS empresa_azonsocial,
								(select direccion from empresa) AS empresa_direccion, 
								(select ruc from empresa) AS empresa_ruc, 

								#suc.descripcion as sucursal_descripcion,
								#suc.telefono as sucursal_telefono,
								#suc.ubicacion as sucursal_ubicacion,
								co.codcomprobante, 
								CONCAT(usu.nombresapellidos) as cajero,
								co.descuento, 
								'' AS detallecomentario,
								grecia AS firma,
								IF(co.codPedido = 0, "00000000",LPAD(co.codpedido,8,0)) AS pedido,
								#pv.codigobarras,
								#pv.codigoBarrasCifrado,
								#pv.MontoAnticipo,
								#pv.efectivo,
								#pv.vuelto,
								(CASE co.codtransaccion 
								WHEN 5 THEN IF(co.codtipocomprobante = 2,"VENTA INTERNA - ANTICIPOS","VENTA INTERNA")
								WHEN 7 THEN "VENTA INTERNA"
								END) as operacion,
								#IFNULL(PV.DocumentoReferenciaAnticipo, "") AS DocumentoReferenciaAnticipo,
								co.subtotal AS venta_subtotal,
								(select telefono from empresa) as telefono,
								(select fax from empresa) as celular,
								(select CONCAT(IFNULL(numeropedido,''),' ',cast(p.fechapedido as date)) from pedido p where p.codpedido=co.codpedido) as fechapedido
								
        
				FROM detallecomprobante dc LEFT JOIN producto p ON p.codProducto = dc.codproducto
						 LEFT JOIN unidadmedida u ON u.codUnidadMedida = dc.unidadingresada 
						 LEFT JOIN comprobante co ON co.codcomprobante = dc.codcomprobante 
						 LEFT JOIN promotor pro ON pro.codPromotor = co.codcliente
						 LEFT JOIN formapago fp ON fp.codFormaPago = co.formapago 
						 LEFT JOIN serie s ON s.codSerie = co.codserie
						 LEFT JOIN moneda mon on mon.codMoneda=co.codmoneda
						 LEFT JOIN usuario usu ON usu.usuarioid = co.codusuario

				WHERE dc.codcomprobante= codcomprobante_  AND co.estado = 1;


END
;;
DELIMITER ;

