-- ----------------------------
-- Procedure structure for ReporteNotaCreditoVenta
-- ----------------------------
DROP PROCEDURE IF EXISTS `ReporteNotaCreditoVenta`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `ReporteNotaCreditoVenta`(codnota int(11), codalma int(11))
BEGIN

DECLARE grecia BLOB;

SELECT
 0 AS NC_codNotaI, 
nc.codcomprobante AS NC_codNotaCredito,
nc.subtotal AS NC_bruto, 
nc.igv AS NC_igv, 
nc.total AS NC_total,
nc.codNotaCredito AS NC_documentoafectado,
fp.descripcion AS NC_formapago,
nc.fechaemision AS NC_fechapago,
fp.descripcion  AS NC_condiciompago,
nc.documentoreferencia as NC_numDocumentoRef,
nc.comprobante as NC_numDocumento, 
#IF(nc.DocumentoFactura LIKE '%NC%', nc.DocumentoFactura, concat("NC-",nc.DocumentoFactura)) as NC_numDocumento,
nc.fechaemision AS NC_fechaemision,
dn.descripcion as NC_motivo,

'' AS NC_MOTIVO_DESCRIPCION,
nc.totalgravadas as NC_gravadas,
nc.totalexoneradas as NC_exoneradas,
nc.totalinafectas as NC_inafectas,
nc.totalgratuitas as NC_gratuitas,
mon.descripcion AS NC_moneda,

(select razonsocial from empresa) AS empresa_razonsocial,
(select direccion from empresa) AS empresa_direccion, 
(select ruc from empresa) AS empresa_ruc, 


 
cl.codPromotor AS cli_codCliente, 
cl.nombre as cli_nombrerazon, 
cl.dni as cli_dniruc,
nc.codtipocomprobante,
cl.direccion AS cli_direccionlegal,

DATE_FORMAT(nc.fecharegistro,'%d-%m-%Y') as fechasalida, 
IFNULL(dnc.cantidad,0) as DNC_cantidad, 
IFNULL(dnc.preciounitario,0) as DNC_preciounitario, 
 
IFNULL(dnc.subtotal,0) as DNC_valorventadet, 
IFNULL(dnc.igv,0)as DNC_igv,  
IFNULL(dnc.total,0)as DNC_total, 
IFNULL(dnc.descuento1,0) AS DNC_descuebto,

dnc.codproducto as DNC_codProducto, 
'' as DNC_referencia, 
IF(dnc.codproducto = 0 ,IFNULL(concat(p.descripcion2,' TALLA ',p.talla),''), IFNULL(concat(p.descripcion2,' TALLA ',p.talla),'')) as DNC_producto, 
dnc.unidadingresada AS DNC_unidadingresada,
IFNULL(u.descripcion,'') as DNC_unidad, 
IFNULL(u.sigla,'') as DNC_siguni,
grecia AS firma
       
FROM detallecomprobante dnc 
INNER JOIN comprobante nc ON dnc.codcomprobante = nc.codcomprobante
INNER JOIN promotor  cl ON cl.codPromotor = nc.codcliente
INNER JOIN formapago fp ON fp.codFormaPago = nc.formapago
LEFT JOIN tipocomprobante td ON nc.codtipocomprobante = td.codtipocomprobante 
LEFT JOIN producto p ON dnc.codProducto = p.codproducto
LEFT JOIN unidadmedida u ON dnc.unidadingresada = u.codUnidadMedida
LEFT JOIN moneda mon on mon.codMoneda=nc.codmoneda
LEFT JOIN discrepancia_notacredito dn on (dn.iddiscrepancianc=nc.coddiscrepancia)

WHERE nc.codcomprobante=codnota  
AND nc.estado = 1 
AND dnc.estado = 1 
AND nc.estado = 1;

      

END
;;
DELIMITER ;

