DECLARE codcomprobante_ int(11);
DECLARE codpago_ int(11);

set codcomprobante_=(select codcomprobante from pagocomprobante  where codpagocomprobante=cod_);
set codpago_=(select codpago from pagocomprobante  where codpagocomprobante=cod_);


select 
cod_ as codigo,
co.comprobante,
IF(co.codtipocomprobante=1,pro.nombre, pro.razonsocial) as cli_nombrerazon, 
co.total ,
(select p.fecha from pago p
where p.codpago=codpago_) as  fecha,

(select p.operacionnumero from pago p
where p.codpago=codpago_) as operacion,
(select p.monto from pago p
where p.codpago=codpago_) as montodeposito,
(select sum(pc.montopagado)
 from pagocomprobante  pc
where pc.codpago=codpago_) as montousado,
(select pc.montofavor
 from pagocomprobante  pc
where pc.codpagocomprobante=cod_) as montofavor

from comprobante co
inner JOIN promotor pro ON pro.codPromotor = co.codcliente
where co.codcomprobante=codcomprobante_;





END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for ReporteTicket
-- ----------------------------
DROP PROCEDURE IF EXISTS `ReporteTicket`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `ReporteTicket`(codticket_ int(11))
BEGIN

				SELECT  
								dt.codproducto AS det_codProducto,
							  p.descripcion2,
								dt.codunidadmedida AS det_codUnidadMedida,
								u.sigla AS det_sigla,
								dt.cantidad AS det_cantidad, 
								dt.precio AS det_preciounitario,
								dt.total AS det_total,      
								cl.codPromotor AS cli_codCliente,
					
								cl.nombre as cli_nombrerazon, 
					
								cl.dni as cli_dniruc,
								t.codtipocomprobante,
								cl.direccion AS cli_direccionlegal,
					
								t.fecha AS venta_Emision, 
								t.subtotal as venta_bruto, 
								t.igv AS venta_igv, 
								t.total AS venta_total, 
								t.codusuario AS venta_codUsuario,
								s.serie AS venta_serie, 
								#mon.descripcion AS venta_moned,
					
								CONCAT(s.serie,'-',LPAD(s.correlativo,8,0)) as venta_numDocumento,
								'TICKET' AS nombredocumento,
								(select razonsocial from empresa) AS empresa_azonsocial,
								(select direccion from empresa) AS empresa_direccion, 
								(select ruc from empresa) AS empresa_ruc, 
								t.codticket, 
								CONCAT(usu.nombresapellidos) as cajero,						
								(select telefono from empresa) as telefono
							
				FROM detalleticket dt LEFT JOIN producto p ON p.codproducto = dt.codproducto
						 LEFT JOIN unidadmedida u ON u.codUnidadMedida = dt.codunidadmedida
						 LEFT JOIN ticket t ON t.codticket = dt.codticket 
						 LEFT JOIN serie s ON s.codtipocomprobante = t.codtipocomprobante 
						 LEFT JOIN promotor cl ON cl.codPromotor = t.codpromotor
						 #LEFT JOIN moneda mon on mon.codMoneda=ct.codmoneda
						 LEFT JOIN usuario usu ON usu.usuarioid = t.codusuario

				WHERE t.codticket= codticket_  AND t.estado = 1;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for ReporteVentasxPedido
-- ----------------------------
DROP PROCEDURE IF EXISTS `ReporteVentasxPedido`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `ReporteVentasxPedido`(numpedido_ varchar(50))
BEGIN
	
				SELECT  
								pro.nombre as cli_nombrerazon, 
								pe.total AS det_total,
								pe.numeropedido
	 
				FROM  pedido pe LEFT JOIN comprobante co ON pe.codpedido = co.codpedido 
						 LEFT JOIN promotor pro ON pro.codPromotor = pe.codpromotor

				WHERE pe.numeropedido= numpedido_  AND pe.estado = 1 limit 2;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for reporte_movimiento_caja
-- ----------------------------
DROP PROCEDURE IF EXISTS `reporte_movimiento_caja`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `reporte_movimiento_caja`(in _cajaid int(11))
begin

DECLARE _montoapertura decimal(10,4) default 0;

set _montoapertura=(
select ROUND(c.montoapertura,2)
from caja c, usuario u
where codcaja=_cajaid and c.codusuario=u.usuarioid
);

select c.codcaja,0 as cobroid,'APERTURA DE CAJA' as concepto, ROUND(c.montoapertura,2) as monto ,'CAJA' as descripcion,
c.fechaapertura as fechacobro,'SD' as nombre ,'' as comprobante, ROUND(c.montoapertura ,2) as total,'' as tipocobro,'' as noperacion,'' as observacion, 
ROUND(c.totalefectivo,2) as totalefectivo,
ROUND(c.totaldeposito,2) as totaldeposito, 
ROUND(c.totaltransferencia,2) as totaltransferencia,
ROUND(c.totaltarjeta,2) as totaltarjeta,
ROUND(c.totalnotacredito,2) as totalnotacredito,
u.nombresapellidos as razonsocial, u.nombresapellidos as nombresapellidos,_montoapertura as montoapertura
from caja c, usuario u
where codcaja=_cajaid and c.codusuario=u.usuarioid
UNION all
select ca.codcaja, codcobro, 'COBRO DE VENTA' as concepto,
ROUND(co.monto,2) as monto, op.descripcion, co.fechacobro, tcc.nombre as nombre, com.comprobante as comprobante, ROUND(com.total,2) as total,tco.descripcion as tipocobro, co.noperacion, co.observacion,
ROUND(totalefectivo,2) as totalefectivo,
ROUND(totaldeposito,2) as totaldeposito, 
ROUND(totaltransferencia,2) as totaltransferencia,
ROUND(totaltarjeta,2) as totaltarjeta,
ROUND(totalnotacredito,2) as totalnotacredito,
cli.nombre as razonsocial, u.nombresapellidos as nombresapellidos, _montoapertura as montoapertura
from caja ca, cobro co, transaccion op,
serie tc, comprobante com, metodopago tco, promotor cli, usuario u,tipocomprobante tcc
where co.codcaja=ca.codcaja
and co.codmetodopago=tco.codMetodoPago
and com.codtransaccion=op.codTransaccion
and co.codcomprobante=com.codcomprobante
and com.codcliente=cli.codPromotor
and com.codserie=tc.codSerie
and com.codtipocomprobante=tcc.codtipocomprobante
and ca.codusuario=u.usuarioid
and ca.codcaja=_cajaid
and co.estado=1;

end
;;
DELIMITER ;

