-- ----------------------------
-- Procedure structure for totales_caja
-- ----------------------------
DROP PROCEDURE IF EXISTS `totales_caja`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `totales_caja`(in _cajaid int(11),
in _estado int(11))
begin
select codcaja,ROUND(montoapertura,2)as montoapertura,
ROUND(montocierre,2)as montocierre, ROUND(totalefectivo,2) as totalefectivo,
ROUND(totaldeposito,2) as totaldeposito, ROUND(totaltransferencia,2) as totaltransferencia,
ROUND(totaltarjeta,2) as totaltarjeta, ROUND(totalnotacredito,2) as totalnotacredito,ROUND(totaldisponible,2) as totaldisponible
from caja where codcaja=_cajaid and estado=_estado;
end
;;
DELIMITER ;

