-- ----------------------------
-- Function structure for strSplit
-- ----------------------------
DROP FUNCTION IF EXISTS `strSplit`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `strSplit`(cadena varchar(255), delimitador  varchar(12), posicion  int(11)) RETURNS varchar(255) CHARSET utf8 COLLATE utf8_spanish_ci
BEGIN
	#Routine body goes here...

	RETURN ltrim(replace(substring(substring_index(cadena, delimitador, posicion), length(substring_index(cadena, delimitador, posicion - 1)) + 1), delimitador, ''));


END
;;
DELIMITER ;
SET FOREIGN_KEY_CHECKS=1;
